import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainContent from './components/MainContent';
import Generator from './components/Generator';
import ActionVerite from './components/ActionVerite';
import Roleplay from './components/Roleplay';
import { CardProvider } from './components/CardContext'; // Importation du CardProvider

const App = () => {
  return (
    <CardProvider> {/* Assurez-vous que tout est envelopp√© dans CardProvider */}
      <Router>
        <Routes>
          <Route path="/" element={<MainComponent />} />
          <Route path="/generator" element={<Generator />} />
          <Route path="/action-verite" element={<ActionVerite />} />
          <Route path="/roleplay" element={<Roleplay />} />
        </Routes>
      </Router>
    </CardProvider>
  );
};

export default App;
